window.addEventListener('DOMContentLoaded', function() {






function plus()
{
return Math.floor(Math.random()*6)-3;
}


function drawRope()
{
let canvas = document.getElementById('ropeTempCanvas');
let ctx = canvas.getContext('2d');
let yPosition=500+fxrand()*1500;



ctx.clearRect(0, 0, 2000, 2000);

ctx.translate(1000, 1000);
let deg=fxrand()*140-70;
ctx.rotate(deg*Math.PI/180);
ctx.translate(-1000, -1000);

ctx.beginPath();      
ctx.moveTo(-1000,yPosition);   
ctx.lineTo(3000, yPosition);  

ctx.lineWidth = 2;
ctx.stroke();


for(let i=1; i<20; i++)
{
let tempOffset=Math.floor(Math.random()*20-10);




let ropeOffset=3;
if (i!==110 && i!==111){
ctx.beginPath();

ctx.moveTo(i*100+tempOffset  + plus(),   yPosition + plus());   
ctx.lineTo(i*100+tempOffset  + plus()-4, yPosition + 5 + plus()); 

ctx.moveTo(i*100+tempOffset  + plus(),   yPosition + plus());   
ctx.lineTo(i*100+tempOffset  + plus()-4, yPosition - 5 + plus());

ctx.moveTo(i*100+tempOffset  + plus() +ropeOffset,    yPosition + plus());   
ctx.lineTo(i*100+tempOffset  + plus() +ropeOffset +4, yPosition + 5 + plus()); 

ctx.moveTo(i*100+tempOffset  + plus() +ropeOffset,    yPosition + plus());   
ctx.lineTo(i*100+tempOffset  + plus() +ropeOffset +4, yPosition - 5 + plus());


ctx.moveTo(i*100+tempOffset  + plus() ,   yPosition - 3 + plus());   
ctx.lineTo(i*100+tempOffset  + plus() ,   yPosition + 3 + plus()); 

ctx.moveTo(i*100+tempOffset  + plus() + ropeOffset*0.33,   yPosition - 3 + plus());   
ctx.lineTo(i*100+tempOffset  + plus() + ropeOffset*0.33,   yPosition + 3 + plus());

ctx.moveTo(i*100+tempOffset  + plus() + ropeOffset*0.66,   yPosition - 3 + plus());   
ctx.lineTo(i*100+tempOffset  + plus() + ropeOffset*0.66,   yPosition + 3 + plus()); 

ctx.moveTo(i*100+tempOffset  + plus() + ropeOffset,   yPosition - 3 + plus());   
ctx.lineTo(i*100+tempOffset  + plus() + ropeOffset,   yPosition + 3 + plus());

ctx.lineWidth = 2;
ctx.stroke();
}
}

let destContext = document.getElementById('NeuroModernFreedomNFT').getContext('2d');
destContext.drawImage(canvas, 400+(fxrand()*800), 400+(fxrand()*800), 800, 800, 0, 0, 1200, 1200);

ctx.translate(1000, 1000);
ctx.rotate(-deg*Math.PI/180);
ctx.translate(-1000, -1000);
ctx.clearRect(0, 0, 2000, 2000);


}
